import Button from './Button.js';
const Proposition = (props) => {
    let {titre} = props;
    return(
        <div className="container">
            <div className="d-flex justify-content-between align-items-center my-5">
                <h3 className="col">{titre}</h3>
                <div className="col">

                    <Button classe="filtre-tous btn  me-2 btn-outline-secondary btn" nom="Tous" />
                    <Button classe="filtre-refuse btn btn-outline-danger btn me-2" nom="Refusée" />
                    <Button classe="filtre-accepte btn btn-outline-success btn" nom="Acceptée" />
                </div>

            </div>
        </div>
    );
}

export default Proposition;
